import { Pipe, PipeTransform } from "@angular/core";


@Pipe({
    name: 'byte',
})
export class BytePipe implements PipeTransform {
    public transform(bytes: number, format: string = 'MB'): string {
        if (format === 'KB') {
            return (bytes / 1024).toFixed(2) + ' KB';
        } else if (format === 'MB') {
            return (bytes / (1024 * 1024)).toFixed(2) + ' MB';
        } else if (format === 'GB') {
            return (bytes / (1024 * 1024 * 1024)).toFixed(2) + ' GB';
        } else if (format === 'TB') {
            return (bytes / (1024 * 1024 * 1024 * 1024)).toFixed(2) + ' TB';
        } else {
            return bytes.toFixed(2) + ' B';
        }
    }
}

import { Pipe, PipeTransform, SecurityContext } from '@angular/core';
import { DomSanitizer, SafeHtml, SafeStyle, SafeScript, SafeUrl, SafeResourceUrl } from '@angular/platform-browser';

@Pipe({
    name: 'safe',
})
export class SafePipe implements PipeTransform {
    constructor(protected sanitizer: DomSanitizer) { }
    public transform(value: any, type: string): SafeHtml | SafeStyle | SafeScript | SafeUrl | SafeResourceUrl {
        switch (type) {
            case 'html':
                value = this.sanitizer.sanitize(SecurityContext.HTML, value);
                /* if (value.includes('src'))
                value = this.sanitizer.sanitize(SecurityContext.RESOURCE_URL, value); */

                return this.sanitizer.bypassSecurityTrustHtml(value);
            case 'html-clean':
                return this.sanitizer.bypassSecurityTrustHtml(value);
            case 'style':
                return this.sanitizer.bypassSecurityTrustStyle(value);
            case 'script':
                return this.sanitizer.bypassSecurityTrustScript(value);
            case 'url':
                return this.sanitizer.bypassSecurityTrustUrl(value);
            case 'resourceUrl':
                return this.sanitizer.bypassSecurityTrustResourceUrl(value);
            default:
                throw new Error(`Invalid safe type specified: ${type}`);
        }
    }
}

